import React from 'react'

const MovieDetail = ({ data }) => {
    const { movieId } = useParams();
    const movie = data.results.find((d) => d.id.toString() === movieId);
  return (
    <div>
      {movie.id}
    </div>
  )
}

export default MovieDetail
